import React from 'react'
import LineItem from './LineItem.js';

const ItemsList = ({items,handleCheck,handleDelete}) => {
  return (
    <ul>
        {items.map((item) => (
          <LineItem 
          item = {item}
          key={item.id}
          handleCheck = {handleCheck}
          handleDelete = {handleDelete}/>
        ))}
    </ul>
  )
}

